(1, 2, 'Beasiswa PPA', '<p><span style=\"font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif; text-align: justify;\"><b>Beasiswa PPA</b> adalah bantuan kuliah dari Kementerian Ristek Dikti yang diperuntukkan bagi mahasiswa aktif jenjang S1/DIV atau D3 yang saat ini berada minimal semester II. Beasiswa PPA dan BPP PPA menyasar mahasiswa-mahasiswa di berbagai daerah, terutama yang tengah kuliah dan berprestasi, baik jenjang sarjana (S1) maupun diploma (DIV/D3). Untuk teknis beasiswa PPA&nbsp; kemungkinan tidak jauh berbeda dengan periode sebelumnya, di mana pendaftaran ditetapkan oleh masing-masing perguruan tinggi.</span><br></p>', '2021-06-21 01:46:13', '2021-06-21 01:46:13');
